// ModeChoice.js

import React from "react";
import { useLocation } from "react-router-dom";

const ModeChoice = () => {
  const location = useLocation();
  const distance = location.state && location.state.distance;

  let mode = "";
  if (distance === "<5km") {
    mode = "Walk / Bicycle";
  } else if (distance === ">5km") {
    mode = "Metro";
  }

  return (
    <div>
      <h1>Mode Choice Page</h1>
      {distance ? (
        <h2>Mode of Transportation: {mode}</h2>
      ) : (
        <h2>No distance information available</h2>
      )}
    </div>
  );
};

export default ModeChoice;
